using Database;
using Microsoft.EntityFrameworkCore;
using Models.Docs;
using Models.Users;
using Models.ValueObjects;
using Services.Docs;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;

namespace Services.Debug
{
    public class TestService : ITestService
    {
        private readonly DatabaseContext _context;

        public TestService(DatabaseContext dataContext)
        {
            _context = dataContext;
        }
        public async Task AddTestRecordsToTheBatabaseAsync()
        {
            try
            {
                User adminUser = new User("Admin", "123456789001", new UserPasswordHash("Qwerty123$").Value());
                User casualUser = new User("User", "123456789002", new UserPasswordHash("Qwwerty123$").Value());
                await _context.Users.AddAsync(adminUser);
                await _context.Users.AddAsync(casualUser);

                _context.SaveChanges();
                DocType docTypeA = new DocType("Бухгалтерский", "Бухгалтерские документы");
                DocType docTypeb = new DocType("Юридический", "Юридические документы");

                await _context.DocTypes.AddAsync(docTypeA);
                await _context.DocTypes.AddAsync(docTypeb);
                _context.SaveChanges();

                await _context.Docs.AddAsync(new Doc("docA.jpg", docTypeA.Id, DateTimeOffset.Now, adminUser.Id, casualUser.Id, ""));
                await _context.Docs.AddAsync(new Doc("docB.jpg", docTypeA.Id, DateTimeOffset.Now, adminUser.Id, casualUser.Id, ""));
                
                _context.SaveChanges();

            }
            catch (Exception ex)
            {

                throw;
            }

        }
    }
}
